export default function Drawer({ isOpen }) {
  const disp = isOpen === true ? "none" : "block";
  return (
    <div
      style={{
        display: disp,
        position: "absolute",
        zIndex: "3",
      }}
    >
      <div
        style={{ width: "100px", height: "100%", backgroundColor: "red" }}
      ></div>
      hello
    </div>
  );
}
